function Operator() {
    return (
        <div>
            <h2>연산자</h2>
            <h3>논리 연산자</h3>
            {/* && : 두 조건이 모두 참일 경우 true 반환 */}
            <p>{true && true}</p> {/* true */}
            {/* 두 조건 중 하나가 거짓이므로 첫 번째 거짓인 값인 false 반환 */}
            <p>{true && false}</p> {/* false */}
            {/* || : 두 조건 중 하나라도 참일 경우 true 반환 */}
            <p>{true || false}</p> {/* true */}
            {/* 두 조건이 모두 거짓이므로 두 번째 거짓인 값인 false 반환 */}
            <p>{false || false}</p> {/* false */}
        </div>
    )
}

export default Operator
